  title: "Category:Pages Needing Cleanup"
  text:
    text: "<p>This category lists the pages that aren't up to par with our standards,\
      \ and need to be cleaned up. In most cases, this is because the article does\
      \ not meet up to the standards set in the <a href=\"/Liandri_Archives:Style_Guide\"\
      \ title=\"Liandri Archives:Style Guide\"> Style Guide</a>, or when the article\
      \ lacks in content. More specific information on what needs to be cleaned up\
      \ on a certain page can be found either on the page itself (in the Cleanup template's\
      \ box), or on the Talk Page.\n</p><p>If you find a page or section that needs\
      \ a cleanup, but is not marked as such, add it to the cleanup list with the\
      \ <code>{{Cleanup}}</code> or <code>{{Cleanup|Section}}</code> template respectively.\n\
